script: |
  super -f text -I q7193.spq | sort > q7193.out

inputs:
  - name: q7193.spq
    data: |
      SELECT - col0 - col1 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT ( + col1 ) IN ( + col0 + - tab0.col0 * - col0 + col1 );
  - name: tab0

outputs:
  - name: q7193.out
    data: |
      -110
      -132
      -180
